// Home.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../LandingPage/Home.css'; 

const Home = () => {
  const navigate = useNavigate();

  const handleJoinNow = () => {
    navigate('/auth'); // Redirect to Signup or any other page
  };

  return (
    <div className="homeContain">
      <div className="homecontent">
        <h1 className="hometitle">Picreco</h1>
        <p className="home-subtitle">Identify the images you appear in</p>
        <button className="join-nowbtn" onClick={handleJoinNow}>
          Join Now
        </button>
      </div>
    </div>
  );
};

export default Home;
